import React, { Component } from 'react';
import Nav from './Nav';
import itemList from './ItemList';
import addItem from './AddItem';

class Home extends Component{

    render(){
        return(
            <div>
                <Nav/>
                <addItem/>
                <itemList/>
            </div>
        )
    }
}

export default Home;
